void ath_ant_div_conf_fast_divbias::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ant_conf_div_group\" :  \"" << ant_conf_div_group.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ant_conf_main_lna_conf\" :  \"" << ant_conf_main_lna_conf.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ant_conf_alt_lna_conf\" :  \"" << ant_conf_alt_lna_conf.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ant_conf_fast_div_bias\" :  \"" << ant_conf_fast_div_bias.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ant_conf_fast_div_bias_ap_vld\" :  \"" << ant_conf_fast_div_bias_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ant_conf_alt_gaintb\" :  \"" << ant_conf_alt_gaintb.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ant_conf_alt_gaintb_ap_vld\" :  \"" << ant_conf_alt_gaintb_ap_vld.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ant_conf_main_gaintb\" :  \"" << ant_conf_main_gaintb.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ant_conf_main_gaintb_ap_vld\" :  \"" << ant_conf_main_gaintb_ap_vld.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"antcomb_ant_ratio\" :  \"" << antcomb_ant_ratio.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"antcomb_fast_div_bias\" :  \"" << antcomb_fast_div_bias.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"antcomb_scan\" :  \"" << antcomb_scan.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"alt_ratio\" :  \"" << alt_ratio.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

